import React from 'react';
import './CategorySection.css';
import { Link } from 'react-router-dom';

const categories = [
  {
    name: 'Pizza',
    image: 'https://media.istockphoto.com/id/1442417585/photo/person-getting-a-piece-of-cheesy-pepperoni-pizza.jpg?s=612x612&w=0&k=20&c=k60TjxKIOIxJpd4F4yLMVjsniB4W1BpEV4Mi_nb4uJU='
  },
  {
    name: 'Burger',
    image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ5Iou-s6SzckiFZgneU3jwPTh5-f8ZeUMxtA&s'
  },
  {
    name: 'Biryani',
    image: 'data:image/jpeg;base64,'
  },
  {
    name: 'South Indian',
    image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTzwE7HveifaqyCaeX07uJWMYCgWiNu81yqOw&s'
  },
  {
    name: 'Desserts',
    image: 'data:image/jpeg;base64,'
  },
  {
    name: 'Chinese',
    image: 'data:image/jpeg;base64,'
  },
  {
    name: 'Snacks',
    image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTbb-W5VSyiyNi3LtYSc-8_2kiCMEFscMZY4g&s'
  }
];

function CategorySection() {
  return (
    <div className="category-section">
      <h2>Browse by Category</h2>
      <div className="category-scroll">
        {categories.map((item, index) => (
          <Link to={`/category/${item.name.toLowerCase()}`} key={index} className="category-card">
            <img src={item.image} alt={item.name} />
            <h3>{item.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
}

export default CategorySection;
